import React from "react";

import {
	Container,
	TituloContainer,
	BotaoAdicionar,
	ProdutoContainer,
	VendasContainer,
	InfoContainer,
	InfoCabecalho,
	InfoConteudo,
	InfoItem,
	FormularioContainer,
	FormularioEdicao,
	LadoEsquerdo,
	LadoDireito,
	ImagemUpload,
	BotaoAtualizar,
} from "./PerfilProdutoElementos";

const Produto = () => {
	return (
		<Container>
			<TituloContainer>
				<h1>Produto</h1>
				<Link to="/novo_produto">
					<BotaoAdicionar>Criar</BotaoAdicionar>
				</Link>
			</TituloContainer>

			<ProdutoContainer></ProdutoContainer>
		</Container>
	);
};

export default Produto;
